import React from "react";
import { Link } from "react-router-dom";
import "./Nav.css";

const Nav = () => (
  <div> 
    <nav>
      <div className="nav-wrapper">
        <a href="#!" className="brand-title">
          Arnab Majumdar
        </a>
        <ul className="right hide-on-med-and-down">

          <li>
          <Link to="/home">Home</Link>{" "}
          </li>
          <li>
          <Link to="/saved/">Portfolio</Link>
          </li>
        </ul>
      </div>
    </nav>
  </div>
);

export default Nav;
